import './App.scss';
import Rodape from './Componentes/Sobre'; 
import Carrossel from './Componentes/Carrossel';
import Formulario from './Componentes/Formulario';
import Navbar from './Componentes/Navbar';

function App() {
  return (
    <>

    <BrowserRouter>
    <Navbar />
    <Routes>
      <Route path='./Componentes/Sobre' element={<Sobre/>}/>
    </Routes>
    </BrowserRouter>

    <Carrossel />
    <Formulario />
    <Rodape />
    </>

  );
}

export default App;
